			printf("* Start track set to %d\n", start_track/2);
			break;

		case 'E':
			if (!(*argv)[2]) usage();
			end_track = (BYTE) (2 * (atoi(&(*argv)[2])));
			printf("* End track set to %d\n", end_track/2);
			break;

		case 'u':
			mode = MODE_UNFORMAT_DISK;
